	std::vector<std::string> FormatterStringsTable::GetStringsTable()
	{
		auto reader = DataReader(GetSerializedStrings(), MaxStringLength);
		auto strings = std::vector<std::string>(StringsCount);
		for (std::int32_t i = 0; i < strings.size(); i++)
		{
			strings[i] = reader.ReadAsciiString();
		}
		if (reader.GetCanRead())
		{
			throw InvalidOperationException();
		}
		return strings;
	}

